The Reform UK–TUV alliance is an electoral pact for the next United Kingdom general election in Northern Ireland between the right-wing populist, Reform UK party and the British unionist and national conservative, Traditional Unionist Voice (TUV). The two parties will stand mutually agreed candidates in up to 18 constituencies in Northern Ireland.


== History ==
The alliance between the two parties was born following the decision of Northern Ireland's largest unionist party, the Democratic Unionist Party (DUP), to re-enter devolved power sharing government at Stormont, ending their boycott over the Northern Ireland Protocol on 3 February 2024. This led the TUV to label the DUP as "Protocol implementers." Former Reform UK MEP, Ben Habib, had previously launched a legal challenge against the NI Protocol alongside TUV leader Jim Allister in February 2021. 


== Platform ==
The electoral pact was announced at the TUV party conference on 16 March 2024, accompanied with a speech from Reform UK leader Richard Tice. The leaders of both parties signed a "Memorandum of Understanding" which outlined a common platform: 

upholding and strengthening the Union between Great Britain and Northern Ireland, including the full restoration of Art 6 of the Act(s) of Union;
equal rights for all citizens within the United Kingdom;
rejection of the Irish Sea border and the subjection of Northern Ireland to EU law and the ECJ;
the completion of a full Brexit so that the United Kingdom in all its parts enjoys full independence and economic freedom;
robust immigration system and controls;
a taxation system, both personal and commercial, which rewards effort.


== Reactions ==
It has been speculated that the alliance could lead to a splitting of the unionist vote and ultimately mean fewer DUP MPs are elected, due to the first-past-the-post electoral system used for Westminster elections. The DUP MP for East Antrim, Sammy Wilson, highlighted this in a critical statement following the formation of the alliance, which he slammed as "absurd" and "self-destructive."


